import React from "react";
export default function About() {
  return (
    <div className="about">
      <h2>About</h2>
      <p>
        Enthusiastic computer science student and aspiring MERN stack developer
        with a passion for software development and problem-solving. Proficient
        in JavaScript, C#, C++, Python, and Java, demonstrating strong
        adaptability, knowledge, and an eagerness to learn new technologies.
      </p>
    </div>
  );
}
